import React, { useState } from 'react';
import Gravity from "./subpages/Gravity";
import MHW from "./subpages/MHW";
import Cs2 from "./subpages/CS";
import "../css/Main.css";
import gravity from "../img/gravity.webp";
import mhw from "../img/モンハン.webp";
import cs2 from "../img/cs2.webp";
import gold from "../img/gold.png";
import silver from "../img/silver.png";
import bronze from "../img/bronze.png";

function Main() {
    const [currentPage, setCurrentPage] = useState<string>("");

    const renderPage = () => {
        switch(currentPage){
            case "gravity":
                return <Gravity />;
            case "MHW":
                return <MHW />;
            case "cs2":
                return <Cs2 />;
            default:
                return(
                    <div className='wrapper'>
                        <h1 className='h'>TOP3 Games</h1>
                        <div className="games">
                            <GameContainer 
                                crown={<img className='bronze' src={bronze} alt='bronze' />} 
                                image={<img className="gravity" src={gravity} alt="cat" onClick={() => setCurrentPage("gravity")} />} 
                                text={<h2 className="gravity third" onClick={() => setCurrentPage("gravity")}>3rd. Gravity Daze</h2>} 
                            />
                            <GameContainer 
                                crown={<img className='gold' src={gold} alt='gold' />} 
                                image={<img className='cs2' src={cs2} alt="cs2" onClick={() => setCurrentPage("cs2")} />} 
                                text={<h2 className='cs2 first' onClick={() => setCurrentPage("cs2")}>1st. Counter Strike</h2>} 
                            />
                            <GameContainer 
                                crown={<img className='silver' src={silver} alt='silver' />} 
                                image={<img className="mhw" src={mhw} alt="mhw" onClick={() => setCurrentPage("MHW")} />} 
                                text={<h2 className="mhw second" onClick={() => setCurrentPage("MHW")}>2nd. MonsterHunter WORLD</h2>} 
                            />
                        </div>
                        <Catch />
                    </div>
                )
        }
    };

    return (
        <>
            {renderPage()}
        </>
    );
}

interface GameContainerProps {
    crown: React.ReactNode;
    image: React.ReactNode;
    text: React.ReactNode;
}

const GameContainer: React.FC<GameContainerProps> = ({ crown, image, text }) => {
    return (
        <div className="game-container">
            {crown}
            {image}
            {text}
        </div>
    );
}

function Catch() {
    return(
        <div className='cathc'>
            <h3>aaaaaaaaaaa</h3>
            <h3>aaaaaaaaaaa</h3>
            <h3>aaaaaaaaaaa</h3>
        </div>
    );
}

export default Main;
